import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the search modal by clicking the search input
    await page.waitForSelector('#mainSearchInput');
    await page.click('#mainSearchInput');

    // Take a screenshot of the modal opened
    await page.waitForSelector('.search-modal');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal.png'));

    // Click the remove button (×) on the first recent search item
    await page.waitForSelector('.search-item:first-child .remove-search');
    await page.click('.search-item:first-child .remove-search');

    // Take a screenshot after clicking the remove button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_remove.png'));

    return {
      success: true,
      action: "Opened search modal and clicked remove button on the first recent search item",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

